$_MODULE['<{myparcel}prestashop>tooltip-data-sharing_afd55e1339054385e7121f1c8206901e'] = 'Als je deze optie inschakelt, kan je webwinkel mogelijk niet langer aan de AVG-wetgeving voldoen.';
$_MODULE['<{myparcel}prestashop>tooltip-data-sharing_6c809e8001373126dd42032306739896'] = 'Daarom, als je deze manier van data delen niet hebt opgenomen in je privacy policy en/of algemene voorwaarden of geen toestemming hebt van klanten, is het over het algemeen aan te raden om deze optie uitgeschakeld te laten.';
$_MODULE['<{myparcel}prestashop>tooltip-google-fonts_c8a5c47e5e6d7fb4e69f7e21880eb0b6'] = 'Het laden van Google Fonts kan mogelijk een probleem opleveren met de AVG-wetgeving';
$_MODULE['<{myparcel}prestashop>tooltip-google-fonts_012daffc66df015718cfa3199a5602e7'] = 'Als je er zeker van wilt zijn dat je webwinkel AVG-proof is, kun je één van de standaard systeemlettertypen kiezen zoals Arial, Verdana, Helvetica, Times New Roman of Courier New. Google Fonts worden in dat geval uitgeschakeld.';
$_MODULE['<{myparcel}prestashop>tooltip-logging_5eabf0c5d481eb4496ce08515801579c'] = 'De logbestanden die aangemaakt worden door deze module kunnen persoonlijke gegevens bevatten. Om te voldoen aan de AVG-wetgeving, zorg ervoor dat de logboeken op de pagina \"%s > %s\" niet langer bewaard blijven dan nodig is.';
$_MODULE['<{myparcel}prestashop>tooltip-notifications_92d2acce2465d99b6662d13cb52f1775'] = 'Notificaties via MyParcel zijn geen vereiste voor een succesvolle levering.';
$_MODULE['<{myparcel}prestashop>tooltip-notifications_ded96d545f62c939f1b233e1bf2b3b25'] = 'Als je deze optie in de MyParcel-backoffice inschakelt en e-mailadressen vanuit de module deelt met MyParcel, dan is het mogelijk dat je webwinkel niet langer voldoet aan de AVG-wetgeving.';
$_MODULE['<{myparcel}prestashop>tooltip-notifications_60e41f7b83b222fe9a77d7e84cba13d3'] = 'Daarom, als je deze manier van data delen niet hebt opgenomen in je privacy policy en/of algemene voorwaarden of geen toestemming hebt van klanten, is het over het algemeen aan te raden om direct e-mails te versturen vanuit';
$_MODULE['<{myparcel}prestashop>icon-delivery-date_88183b946cc5f0e8c96b2e66e1c74a7e'] = 'Onbekend';
$_MODULE['<{myparcel}prestashop>backoffice_top_176f3711d28c6e2adbadb999a4b4c4c3'] = 'Zodra je klaar bent met configureren kun je op \"Hervatten\" klikken om verder te gaan met de rondleiding.';
$_MODULE['<{myparcel}prestashop>backoffice_top_e1eadf53b7a1ee97ad46cbd46fb04ddf'] = 'Hi %s, welkom bij de nieuwe MyParcel module.[1]Om snel te beginnen met deze module kun je deze korte rondleiding door de module volgen.';
$_MODULE['<{myparcel}prestashop>backoffice_top_4360ce95130d0263496a19469fe0223b'] = 'We lopen nu even door de benodigde instellingen in MyParcel.[1]Je kunt ze tijdens de tour direct invullen. Je krijgt daarnaast nog wat handige tips! Over een paar minuten ben je klaar om jouw eerste verzendingen te versturen met de module.[1]Voer als eerste je API-key in.';
$_MODULE['<{myparcel}prestashop>backoffice_top_40718b2915ebb30aae1c79fd9f6f99f8'] = 'Op deze pagina kun je de gewenste bezorgopties instellen. Deze worden op de checkout weergegeven, alwaar de klant een keuze kan maken.[1]De instellingen worden opgeslagen per vervoerder, het is dus mogelijk om een vervoerder met afwijkende opties toe te voegen.[1]Ook zijn uitgebreide zendopties naar België mogelijk.';
$_MODULE['<{myparcel}prestashop>backoffice_top_156ded7882fcac137eccd5fce9d5e6f5'] = 'Om de checkout helemaal naar jouw smaak aan te passen is het mogelijk om de kleuren en lettertype aan te passen op deze pagina. De kleuren worden meteen bijgewerkt, waardoor je gelijk het eindresultaat kunt zien in de preview.[1]Als je de checkout hebt aangepast aan jouw wensen, kun je vervolgens de wijzigingen opslaan. Toch niet helemaal tevreden met de wijzigingen? Met de reset-knop kun je de fabrieksinstellingen herstellen.';
$_MODULE['<{myparcel}prestashop>backoffice_top_44a1e48b97ac72a6c1726cec578ad996'] = 'Onderaan deze pagina vind je de mogeljkheid om de beschrijvingen op labels aan te passen. Een label kun je nog verder personaliseren door een logo te uploaden via de MyParcel backoffice.[1]Onder deze optie is het mogelijk om het printformaat aan te passen en om je voorkeur vast te leggen. Zet \"Altijd om de paginakeuze vragen\" uit om sneller te kunnen printen vanuit de backoffice.[1]Het is mogelijk om je orderstatussen te koppelen aan de verzendstatus bij PostNL. Kies hiervoor één of meerdere van de beschikbare statussen en ze zullen automatisch worden toegepast. Als je statussen hebt die absoluut niet mogen veranderen, dan is het mogelijk om deze op te geven in de lijst eronder. Zolang een bestelling één van deze statussen heeft wordt de bestelling niet langer automatisch aangepast.[1]Verzendnotificaties kunnen per %s worden verzonden. De klant wordt geïnformeerd over zowel de zending zelf als de afhaallocatie wanneer deze optie wordt ingeschakeld.';
$_MODULE['<{myparcel}prestashop>backoffice_top_2418e90b70af68c39b433073de140528'] = 'Met de wizard op deze pagina is het mogelijk om de vervoerder in te stellen. Wij hebben alvast een aantal items voorgeconfigureerd.[1]In de volgende stappen van de wizard kun je de kosten opgeven, de maximale afmetingen en vervolgens de vervoerder in te schakelen.';
$_MODULE['<{myparcel}prestashop>backoffice_top_b7cff0cfa714c6152e983a4f63fbd47f'] = 'Op de bestellingspagina en -lijst staan nu voortaan MyParcel-icoontjes. Door vervolgens op een icoontje te klikken krijg je meteen de mogelijkheid om een label aan te maken en te printen. Handig![1]Voor nog meer informatie kun je [2]de volledige handleiding[/2] bekijken.';
